/* ================ TIMER ================ */
#timer{
  font-family: "Digit";
  font-size: 1.5rem;
  text-align: center;
  width: 6rem;
  height: 4rem;
  border-radius: 2.25rem/50%;
  border: 1px solid var(--primary-color);
  color: var(--primary-color);
  background-color: var(--secondary-color);
  position: absolute;
  right: 1.8rem;
  top: 2rem;
  display: flex;
  justify-content: center;
  align-items: center;
}


/* ================ BOX QUIZ ================ */
.box_quiz form{
  display: flex;
  flex-flow: column nowrap;
  justify-content: space-between;
  align-items: stretch;
}
